import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var XSquare = createReactComponent("XSquare", ["svg", defaultAttributes, [["rect", {
  x: "3",
  y: "3",
  width: "18",
  height: "18",
  rx: "2",
  ry: "2",
  key: "1sylwi"
}], ["line", {
  x1: "9",
  y1: "9",
  x2: "15",
  y2: "15",
  key: "bhcchc"
}], ["line", {
  x1: "15",
  y1: "9",
  x2: "9",
  y2: "15",
  key: "jmj1s"
}]]]);
export default XSquare;
